import "./css/styles.css";
import "./css/w3schools.css";


export default class ContactMe extends Component {
  render() {
    return (
      <div id="contactme">
      <h3 class="main montserrat large"> CONTACT ME </h3>
      <p><a href="mailto:carolineabel@college.harvard.edu" class="medium montserrat">Email: carolineabel@college.harvard.edu</a></p>
      <a href="https://www.linkedin.com/in/caroline-abel">LinkedIn</a>
      <a href="https://www.linkedin.com/in/caroline-abel">Github</a>
      </div>
    )
  }
}
